css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #525a61;
  padding: 6px;
  border-bottom: 1px solid #2d3a45;
}
.github-Accordion-header::-webkit-details-marker {
  color: #525a61;
}
.github-Accordion-content {
  border-bottom: 1px solid #2d3a45;
  background-color: #1D252C;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #525a61;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #ffffff;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 3px;
  border-bottom: 1px solid #2d3a45;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #2d3a45;
}
